import axios from "axios"

import {
    ADDRESS_REQUEST,
    ADDRESS_REQUEST_SUCCESS,
    ADDRESS_REQUEST_FAIL
} from "../types/AddressType"


export const getAddress = (address) => async (dispatch) => {

    dispatch({
        type: ADDRESS_REQUEST
    })
    try {
        const  data  = await axios.get(`https://api.digitransit.fi/geocoding/v1/search?text=${address}&size=1`)

        dispatch({
            type:ADDRESS_REQUEST_SUCCESS,
            payload:data
        })

    } catch (error) {
        dispatch({
            type: ADDRESS_REQUEST_FAIL,
            payload: error
        })
    }
}
